script: |
  super -f text -I q4643.spq | sort > q4643.out

inputs:
  - name: q4643.spq
    data: |
      SELECT ALL + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 + + col2 NOT BETWEEN ( - - 13 ) AND + 99 / 3 + - col2 + + ( 2 + col2 * ( + col0 + col1 ) );
  - name: tab1

outputs:
  - name: q4643.out
    data: |
      3
